    the North Atlantic Ocean from the PHYSALIA from 23 January 1946 to 13 July 1946.
    Bottle data include profiles of temperature, salinity, and pH. Nutrients data include
    concentration profiles of oxygen, nitrate, nitrate, phosphate, total phosphate,
    chlorophyll a, and ammonia. Data were collected by the Woods Hole Oceanographic
    Institute (WHOI). Additional funding for digitizing historic data were provided
